pragma solidity 0.8.0;

import "../node_modules/@OpenZeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@OpenZeppelin/contracts/utils/math/SafeMath.sol";
import "../node_modules/@OpenZeppelin/contracts/access/Ownable.sol";

contract Wallet is Ownable{
    using SafeMath for uint;

    struct Token{
        bytes32 ticker;
        address tokenAddress;
    }

    mapping(bytes32 => Token) public tokenmapping;
    bytes32[] public tokenlist;

    mapping(address => mapping(bytes32 => uint)) public balance;

    modifier TokenExist(bytes32 ticker){
         require(tokenmapping[ticker].tokenAddress != address(0), "No token ticker");
         _;
    }

    function addToken(bytes32 ticker, address tokenAddress) onlyOwner external{
        tokenmapping[ticker] = Token(ticker, tokenAddress);
        tokenlist.push(ticker);
    }

    function deposit(bytes32 ticker, uint amount) TokenExist(ticker) external {
        require(amount > 0, "Enter more token");

        IERC20(tokenmapping[ticker].tokenAddress).transferFrom(msg.sender,address(this), amount);
        balance[msg.sender][ticker] = balance[msg.sender][ticker].add(amount);
    }

    function withdraw(bytes32 ticker, uint amount) TokenExist(ticker) external {
        require(balance[msg.sender][ticker] >= amount, "balance no sufficient");

        balance[msg.sender][ticker] = balance[msg.sender][ticker].sub(amount);
        IERC20(tokenmapping[ticker].tokenAddress).transfer(msg.sender, amount);
    }

    function depositETH() external payable {
        balance[msg.sender][bytes32("ETH")] = balance[msg.sender][bytes32("ETH")].add(msg.value);
    }

    function getETH() public view returns(uint) {
        return  balance[msg.sender][bytes32("ETH")];
    }


}
